import { useCallback, useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import styles from "./Frame3.module.css";

const Frame3 = () => {
  const navigate = useNavigate();

  const onRectangleImage3Click = useCallback(() => {
    navigate("/frame-6");
  }, [navigate]);

  const [orderData, setOrderData] = useState([]);

  useEffect(() => {
    // Function to fetch order data from the server
    const fetchOrderData = () => {
      fetch('/order') // Replace with your server's API endpoint
        .then((response) => {
          if (!response.ok) {
            throw new Error('Network response was not ok');
          }
          return response.json();
        })
        .then((data) => {
          setOrderData(data);
        })
        .catch((error) => {
          console.error('Error fetching orders:', error);
        });
    };

    // Fetch data initially
    fetchOrderData();

    // Fetch data every second
    const intervalId = setInterval(fetchOrderData, 1000);

    // Clear the interval when the component unmounts
    return () => clearInterval(intervalId);
  }, []);

  return (
    <div className={styles.rectangleParent}>
      {/* ...rest of your component code... */}
      <table className={styles.frameChild}>
        <thead>
          <tr>
            <th>Name</th>
            <th>Quantity</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {orderData.map((order, index) => (
            <tr key={index}>
              <td>{order.name}</td>
              <td>{order.quantity}</td>
              <td>{order.price}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Frame3;
